import { Avatar } from '@mui/material'
import React from 'react'
import "./InfoSection.css"
import pic from "../../../images/DSC09653.jpeg";

export default function InfoSection() {
  return (
    <div className='info_container'>
        <div className='info_image'>
            <Avatar src={pic } />
        </div>
    </div>
  )
}
